function switchCloud(number) {
  switch (number) {
    case 1:
      return (
        <>
          <title>Clear, cloudless sky</title>
          {cloudlessSky()}
        </>
      );
    case 2:
      return (
        <>
          <title>Clear, few cirrus</title>
          {cloudlessSky()}
          {fewCirrus()}
        </>
      );
    case 3:
      return (
        <>
          <title>Clear with cirrus</title>
          {cloudlessSky()}
          {withCirrus()}
        </>
      );
    case 4:
      return (
        <>
          <title>Clear with few low clouds</title>
          {cloudlessSky()}
          {withFewLowClouds()}
        </>
      );
    case 5:
      return (
        <>
          <title>Clear with few low clouds and few cirrus</title>
          {cloudlessSky()}
          {fewCirrus()}
          {withFewLowClouds()}
        </>
      );
    case 6:
      return (
        <>
          <title>Clear with few low clouds and cirrus</title>
          {cloudlessSky()}
          {withCirrus()}
          {withFewLowClouds()}
        </>
      );
    case 7:
      return (
        <>
          <title>Partly cloudy</title>
          {cloudlessSky()}
          {partyCloudy()}
        </>
      );
    case 8:
      return (
        <>
          <title>Partly cloudy and few cirrus</title>
          {cloudlessSky()}
          {partyCloudy()}
          {fewCirrus()}
        </>
      );
    case 9:
      return (
        <>
          <title>Partly cloudy and cirrus</title>
          {cloudlessSky()}
          {partyCloudy()}
          {withCirrus()}
        </>
      );
    case 10:
      return (
        <>
          <title>Mixed with some thunderstorm clouds possible</title>
          {cloudlessSky()}
          {withSomeThunderstorm()}
        </>
      );
    case 11:
      return (
        <>
          <title>Mixed with few cirrus with some thunderstorm clouds possible</title>
          {cloudlessSky()}
          {fewCirrus()}
          {withSomeThunderstorm()}
        </>
      );
    case 12:
      return (
        <>
          <title>Mixed with cirrus and some thunderstorm clouds possible</title>
          {cloudlessSky()}
          {withCirrus()}
          {withSomeThunderstorm()}
        </>
      );
    case 13:
      return (
        <>
          <title>Clear but hazy</title>
          {cloudlessSky()}
          {butHazy()}
        </>
      );
    case 14:
      return (
        <>
          <title>Clear but hazy with few cirrus</title>
          {cloudlessSky()}
          {butHazy()}
          {fewCirrus()}
        </>
      );
    case 15:
      return (
        <>
          <title>Clear but hazy with cirrus</title>
          {cloudlessSky()}
          {butHazy()}
          {withCirrus()}
        </>
      );
    case 16:
      return (
        <>
          <title>Fog/low stratus clouds</title>
          {cloudlessSky()}
          {butHazy()}
          {partyCloudy()}
        </>
      );
    case 17:
      return (
        <>
          <title>Fog/low stratus clouds with few cirrus</title>
          {cloudlessSky()}
          {butHazy()}
          {partyCloudy()}
          {fewCirrus()}
        </>
      );
    case 18:
      return (
        <>
          <title>Fog/low stratus clouds with cirrus</title>
          {cloudlessSky()}
          {butHazy()}
          {partyCloudy()}
          {withCirrus()}
        </>
      );
    case 19:
      return (
        <>
          <title>Mostly cloudy</title>
          {cloudlessSky()}
          {mostlyCloudy()}
        </>
      );

    case 20:
      return (
        <>
          <title>Mostly cloudy and few cirrus</title>
          {cloudlessSky()}
          {mostlyCloudy()}
          {fewCirrus()}
        </>
      );
    case 21:
      return (
        <>
          <title>Mostly cloudy and cirrus</title>
          {cloudlessSky()}
          {mostlyCloudy()}
          {withCirrus()}
        </>
      );
    case 22:
      return (
        <>
          <title>Overcast</title>
          {overcast()}
        </>
      );
    case 23:
      return (
        <>
          <title>Overcast with rain</title>
          {overcast()}
          {rain()}
        </>
      );
    case 24:
      return (
        <>
          <title>Overcast with snow</title>
          {overcast()}
          {snow()}
        </>
      );
    case 25:
      return (
        <>
          <title>Overcast with heavy rain</title>
          {overcast()}
          {heavyRain()}
        </>
      );
    case 26:
      return (
        <>
          <title>Overcast with heavy snow</title>
          {overcast()}
          {heavySnow()}
        </>
      );
    case 27:
      return (
        <>
          <title>Rain, thunderstorms likely</title>
          {thunderstormsLikely()}
          {rainThunderstormsLikely()}
        </>
      );
    case 28:
      return (
        <>
          <title>Light rain, thunderstorms likely</title>
          {thunderstormsLikely()}
          {lightRainThunderstormsLikely()}
        </>
      );
    case 29:
      return (
        <>
          <title>Storm with heavy snow</title>
          {stormHeavySnow()}
        </>
      );
    case 30:
      return (
        <>
          <title>Heavy rain, thunderstorms likely</title>
          {heavyRain()}
          {thunderstormsLikely()}
        </>
      );
    case 31:
      return (
        <>
          <title>Mixed with showers</title>
          {cloudlessSky()}
          {mixed()}
          {mixedShowers()}
        </>
      );
    case 32:
      return (
        <>
          <title>Mixed with snow showers</title>
          {cloudlessSky()}
          {mixed()}
          {mixedSnowShowers()}
        </>
      );
    case 33:
      return (
        <>
          <title>Overcast with light rain</title>
          {overcast()}
          {mixedShowers()}
        </>
      );
    case 34:
      return (
        <>
          <title>Overcast with light snow</title>
          {overcast()}
          {mixedSnowShowers()}
        </>
      );
    case 35:
      return (
        <>
          <title>Overcast with mixture of snow and rain</title>
          {overcast()}
          {mixedSnowAndRainShowers()}
        </>
      );

    default:
      return <></>;
  }
}

function WeatherForecastIcon(props) {
  const { pictocode = 0 } = props;
  return (
    <svg className={styles.icon} viewBox="0 0 40 40" {...props}>
      {switchCloud(pictocode)}
    </svg>
  );
}

export default WeatherForecastIcon;
WeatherForecastIcon.defaultProps = {
  pictocode: 0,
};
